import React from "react"
import './App.css'
import Nav from './Navbar'
import Tables from './components/Table';
import TableSelection from "./components/SearchWithListBar";


const Home = ({history}) =>{
  return(
    <>
    <Nav/>
    <TableSelection/>
    <div className="tablesCSS">     
      <Tables history={history}/>
    </div>
    
    
    </>
  )
}

export default Home
